import React, { useState, useEffect } from 'react';
import { Link, useLocation, useNavigate } from 'react-router-dom';

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const location = useLocation();
  const navigate = useNavigate();

  useEffect(() => {
    const authStatus = localStorage.getItem('isAdminAuthenticated') === 'true';
    setIsAuthenticated(authStatus);
  }, []);

  const isActive = (path) => location.pathname === path;

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <header>
      <div className="container">
        <nav className="navbar">
            <Link to="/login" className="logo"><img src="./images/logos/Sample Logo 3D 1.png" alt="Rotary with Unit Logo" width="100" height="50" /></Link>
          <div className="hamburger-menu" onClick={toggleMenu}>
            <span></span>
            <span></span>
            <span></span>
          </div>
          <ul className={`nav-links ${isMenuOpen ? 'active' : ''}`}>
            <li><Link to="/" className={isActive('/') ? 'active' : ''}>Home</Link></li>
            <li><Link to="/about" className={isActive('/about') ? 'active' : ''}>About</Link></li>
            <li><Link to="/events" className={isActive('/events') ? 'active' : ''}>Events</Link></li>
            <li><Link to="/points" className={`nav-link ${location.pathname === '/' ? 'active' : ''}`}>Points Table</Link></li>
            <li><Link to="/schedule" className={isActive('/schedule') ? 'active' : ''}>Schedule</Link></li>
            <li><Link to="/images" className={isActive('/images') ? 'active' : ''}>Photos</Link></li>
            <li><Link to="/registration" className={isActive('/registration') ? 'active' : ''}>Registration</Link></li>
            <li><Link to="/contact" className={isActive('/contact') ? 'active' : ''}>Contact</Link></li>
            {isAuthenticated ? (
              <li>
                <Link 
                  to="/admin" 
                  className={isActive('/admin') ? 'active' : ''}
                  onClick={() => setIsMenuOpen(false)}
                >
                  Admin
                </Link>
              </li>
            ) : (
              <li>
                <Link 
                  to="/login" 
                  className={isActive('/login') ? 'active' : ''}
                  onClick={() => setIsMenuOpen(false)}
                >
                  Login
                </Link>
              </li>
            )}
            {isAuthenticated && (
              <li>
                <button 
                  onClick={() => {
                    localStorage.removeItem('isAdminAuthenticated');
                    setIsAuthenticated(false);
                    navigate('/login');
                    setIsMenuOpen(false);
                  }}
                  style={{
                    background: 'none',
                    border: 'none',
                    color: '#333',
                    fontWeight: '600',
                    cursor: 'pointer',
                    padding: '8px 15px',
                    transition: 'color 0.3s'
                  }}
                  onMouseEnter={(e) => e.target.style.color = '#d32f2f'}
                  onMouseLeave={(e) => e.target.style.color = '#333'}
                >
                  Logout
                </button>
              </li>
            )}
          </ul>
        </nav>
      </div>
    </header>
  );
};

export default Header;
